import { Link } from "react-router-dom";

const NavbarHome = () => {
  return (
    <nav style={styles.nav}>
      <h2>Sistema</h2>
      <ul style={styles.links}>
        <li><Link to="/clientes">Cliente</Link></li>
        <li><Link to="/funcionarios">Funcion√°rio</Link></li>
        <li><Link to="/sobre">Sobre</Link></li>
      </ul>
    </nav>
  );
};

const styles = {
  nav: { display: "flex", justifyContent: "space-between", padding: "1rem", background: "#333", color: "#fff" },
  links: { listStyle: "none", display: "flex", gap: "1rem" },
};

export default NavbarHome;
